import React from 'react';
import Dashboard from'./views/dashboard/Dashboard';
import Users from'./views/users/Users';
import User from'./views/users/User';

// const Dashboard = React.lazy(() => import('./views/daUsers\'));\n' +
// 'const User = React.lazy(() => import(\'./views/users/Ushboard/Dashboard'));
// const Users = React.lazy(() => import('./views/users/ser'));

const routes = [
  { path: './admin', exact: true, name: 'Home' },
  { path: '/admin/dashboard', name: 'Dashboard', component: Dashboard },
  { path: '/admin/users', exact: true,  name: 'Users', component: Users },
  { path: '/admin/users/:id', exact: true, name: 'User Details', component: User }
];

export default routes;
